import { useState, useCallback, useEffect } from "react";
import "./GetFetch.css";

// import Button from "../UI/Button.js";
// import ListData from "./ListData.js";

const GetFetch = () => {
  const [img, setImg] = useState([]);

  const fetchHandler = useCallback(async () => {
    try {
      const list = await fetch("https://picsum.photos/v2/list/id/{id}/info");
      const images = await list.json();

      if (!list.ok) {
        throw new Error("Something went wrong!");
      }

      console.log(images);

      setImg(images);
    } catch (error) {
      console.log(error);
    }
  }, []);

  useEffect(() => {
    fetchHandler();
  }, [fetchHandler]);

  return (
    <div>
      {img.map(function (o) {
        return (
          <div key={"item-" + o.id} id="singleDiv">
            {<img id="imgId" src={o.download_url} alt="icons" />}
          </div>
        );
      })}
    </div>
  );
};

export default GetFetch;
